// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

contract LotteryGame {
    fallback() external {}

    receive() external payable {}

    event PlayerJoins(address player);
    struct Lottery {
        address[] games;
        uint winner;
    }
    uint private SUBSCRIPTION_ID =
        76025552955773742409598247589851646688819278531780743956534831031639761126863;

    mapping(uint => Lottery) private allAddresses;
    uint private counter;

    constructor() {
        counter = 1;
    }

    function joinLottery() external payable {
        require(msg.value > 0.01 ether, "INSUFFICIENT BALANCE");

        for (uint i; i < allAddresses[counter].games.length; i++) {
            require(
                allAddresses[counter].games[i] != msg.sender,
                "No Double Entry into a lottery"
            );
        }

        if (allAddresses[counter].games.length == 10) {
            getWinner();
        }

        allAddresses[counter].games.push(msg.sender);
        emit PlayerJoins(msg.sender);
    }

    function getRandomNumber() private returns (uint) {
        return 1;
    }

    event LastLotteryWinner(address user);
    modifier onlyOwner(){
        require (msg.sender == address(this), "UNAUTHORISED");
        _;
    }
    function getWinner() public payable onlyOwner {
        uint randomNumber = getRandomNumber() % 10;
        allAddresses[counter].winner = randomNumber;
        payable(allAddresses[counter].games[randomNumber]).transfer(0.1 ether);

        emit LastLotteryWinner(allAddresses[counter].games[randomNumber]);
        counter += 1;
    }
}

